import React from "react";
import {BrowserRouter, Router, Routes, Route} from "react-router-dom";
import Home from "./pages/home";

function App(){
    return(
        <Router>
            <Routes>
                <Route path='/' element={Home}></Route>
            </Routes>
        </Router>
    )
}

export default App;
